import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Ensure you create the corresponding CSS file

const Navbar = () => {
  return (
    <motion.div
      className="navbar"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 1 }}
    >
      <motion.div
        className="navbar-container"
        initial={{ x: -200 }}
        animate={{ x: 0 }}
        transition={{ type: 'spring', stiffness: 120 }}
      >
        <Link to="/home" className="logo">
          Signify
        </Link>
        <div className="menu">
          <motion.div
            className="menu-item"
            whileHover={{ scale: 1.1, color: '#00c9a7' }}
            transition={{ type: 'spring', stiffness: 200 }}
          >
            
          </motion.div>
          <motion.div
            className="menu-item"
            whileHover={{ scale: 1.1, color: '#00c9a7' }}
            transition={{ type: 'spring', stiffness: 200 }}
          >
            <Link to="/login">Login</Link>
          </motion.div>
          <motion.div
            className="menu-item"
            whileHover={{ scale: 1.1, color: '#00c9a7' }}
            transition={{ type: 'spring', stiffness: 200 }}
          >
            <Link to="/signup">Sign Up</Link>
          </motion.div>
          <motion.div
            className="menu-item"
            whileHover={{ scale: 1.1, color: '#00c9a7' }}
            transition={{ type: 'spring', stiffness: 200 }}
          ><Link to="/aboutus">About Us</Link>
          </motion.div>
        </div>
      </motion.div>
    </motion.div>
  );
};

export default Navbar;
